import React from 'react'
import styled from 'styled-components'
import Card from '../components/Card';

const Container = styled.div`
display:flex;
justify-content:space-between;

`;

export default function Home() {
  return (
    <Container>
        <Card/>

        <Card/><Card/>
        <Card/>
    </Container>
  )
}
